Glenda Bennett, Glenda Bennett, &quot;Celtic Woodcraft: Authentic Projects for Woodworkers&quot;
Sterling | 2004 | ISBN: 1861082444 | 128 pages | SCAN + PDF

Celtic knot work and other designs of early Ireland are immensely popular, so it's about time that someone created a woodworking title featuring these powerful images. Bennett, a self-taught woodworker who hopes to encourage beginners, here offers a collection of 20 projects appropriate for woodworkers of every skill level. This reviewer has not been so excited about a new project book in years; the designs are beautiful and so diverse that they should appeal to nearly everyone. Projects include appliqu knots and borders, a Claddach love spoon, a hand mirror, an eagle wall plaque, picture frames, boxes, coasters, a mirrored candle sconce, and a standing Celtic cross (this reviewer's current project). Several projects successfully combine multiple materials, including scroll-sawn brass or stained glass. Each project includes excellent step-by-step instructions, profuse color photos, and a pattern. This title is a pleasure to read and, more important, to work from and should be included in every public library collection.
